import { Box, Typography } from "@mui/material";

const Order = () => {
  return (
    <Box
      display="flex"
      flexDirection="column"
      alignItems="center"
      width="100%"
      sx={{ boxSizing: "border-box" }}
    >
      <Box
        display="flex"
        alignItems="center"
        justifyContent="center"
        width="100%"
        bgcolor="primary.main"
        py={2}
        sx={{
          boxSizing: "border-box",
        }}
      >
        <Box
          sx={{ width: "100px", height: "100px", border: "1px solid black" }}
        ></Box>
        <Box
          sx={{ width: "100px", height: "100px", border: "1px solid black" }}
        ></Box>
        <Box
          sx={{ width: "100px", height: "100px", border: "1px solid black" }}
        ></Box>
      </Box>
    </Box>
  );
};

export default Order;
